import React from "react";
import {useState} from "react";
import Container from 'react-bootstrap/Container'
import {Row,Col} from 'react-bootstrap'
import "./AdminDashboard.css"
import officerData from "./officerData"
import sponsorData from "./sponsorData"
import videoData from "./videoData"
import AddOfficersPage from "./AddOfficersPage"

const AdminDashboard = () => {
    const [display,setDisplay] = useState("officer")

    return (
        <Container className = "AdminDashboard">
            <Row>
                <Col><button onClick={() => setDisplay("officer")}>Officers</button></Col>
                <Col><button onClick={() => setDisplay("sponsor")}> Sponsors</button></Col>
                <Col><button onClick={() => setDisplay("video")}>Videos</button></Col>
            </Row>
            <Row>
                {display === "officer" && <AddOfficersPage />}
                {display === "sponsor" && <AddOfficersPage />}
                {display === "video" && <AddOfficersPage />}
            </Row>
        </Container>
    )
};

  export default AdminDashboard;
